import { React } from "react";
import "./styles.css";
import Navbar from "./components/navbar";
import Card from "./components/card";
import WelcomeInfo from "./components/welcomeInfo";

export default function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="AboutMe">
        <Card/> <WelcomeInfo/>
      </div>      
    </div>
  );
}
